Require Import BigZ.
Local Open Scope bigZ_scope.

Definition add := BigZ.add.
Definition mul := BigZ.mul.
Definition sqrt := BigZ.sqrt.
Definition div := BigZ.div.
Definition opp := BigZ.opp.
Definition zero := 0%bigZ.

Require Import List.
Import ListNotations.

Set Implicit Arguments.
Unset Strict Implicit.
Unset Printing Implicit Defensive.

Section prog.

Fixpoint stilde k c a b :=
  match k, a, b with
    | O, _, _ => c
    | S k, nil, _ => c
    | S k, _, nil => c
    | S k, a1 :: a2, b1 :: b2 => stilde k (add c (opp (mul a1 b1))) a2 b2
  end.

Definition ytilded k c a b bk := div (stilde k c a b) bk.

Definition ytildes k c a := sqrt (stilde k c a a).

Fixpoint lstore T s n (v : T) :=
  match n, s with
    | _, nil => nil
    | O, _ :: t => v :: t
    | S n, h :: t => h :: lstore t n v
  end.

Fixpoint store T m i j (v : T) :=
  match i, m with
    | _, nil => nil
    | O, h :: t => lstore h j v :: t
    | S i, h :: t => h :: store t i j v
  end.

Section InnerLoop.
Variable j : nat.
Fixpoint inner_loop_rec (k : nat) A R (i : nat) {struct k} :=
  match k with
  | O (* i >= j) *) => R
  | S k => let R := store R j i (ytilded i (nth j (nth i A nil) zero)
                                         (nth i R nil) (nth j R nil)
                                         (nth i (nth i R nil) zero)) in
           inner_loop_rec k A R (S i)
  end.
Definition inner_loop A R i := inner_loop_rec (j - i) A R i.
End InnerLoop.

Section OuterLoop.
Variable n : nat.
Fixpoint outer_loop_rec k A R (j : nat) {struct k} :=
  match k with
  | O (* j >= n *) => R
  | S k =>
    let R := inner_loop j A R 0 in
    let R := store R j j (ytildes j (nth j (nth j A nil) zero)
                                    (nth j R nil)) in
    outer_loop_rec k A R (j + 1)
  end.
Definition outer_loop A R j := outer_loop_rec (n - j) A R j.
End OuterLoop.

Definition prog A :=
  let sz := length A in
  outer_loop sz A A 0.

End prog.

